function Button(props) {
    const style = {
        height: '90px',
        width: '90px',
        marginLeft: '10px',
        borderRadius: '30px',
        borderColor: 'black',
        borderWidth: '3px'
    }
  return (
      <button style={style} type ='button'>{props.text}</button>
  );
}

export default Button;
